import React, { useState } from "react";
import RedirectAcount from "./redirectAcount";

const Options = (props) => {
  const [login, setLogin] = useState(false);
  return (
    <>
      {login ? (
        <RedirectAcount
          title={props.title}
          text="ACCEDE A TU CUENTA"
          link="/cuenta"
          image={props.image}
        />
      ) : (
        <RedirectAcount
          title={props.title}
          text="ACCEDE A TU CUENTA"
          link="/acceder"
          image={props.image}
        />
      )}
    </>
  );
};

export default Options;
